        src="https://app.vidzflow.com/v/H0LDXZjsnq?dq=576&ap=true&muted=true&loop=true&ctp=false&bc=%234E5FFD&controls=%27"
        autoPlay
        loop
        muted
      />
      <div style={{ position: "relative" }}>{/* Your content goes here */}</div>
    </div>
  );
};

export default Landing;

